import React from "react";
import { BrowserRouter as Router, Route, Routes,R } from "react-router-dom";
import { Navigation, Footer, Home, Contact, SignUp, SignIn, Doctprofile } from "./components";

class App extends React.Component {

  render() {
    return (
      <div className="App">
        <Router>
          <Navigation />
          <Routes>

            {true ?
              <Route exact path="/" element={<Home />} />
              :
              window.location.assign('/')
            }
            <Route path="/doctorNotAPP" element={<Doctprofile />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/signup" element={<SignUp />} />
            <Route path="/signin" element={<SignIn />} />
          </Routes>
        </Router>
      </div>
    );
  }
}
export default App;
